import React from 'react'
import {
	View,
	StyleSheet,
	Text,
	TextInput,
	Pressable,
	Button,
 } from "react-native";
import List from '../components/List';
import TodoForm from '../components/TodoForm';

const Todo = () => {
  return (
	  <View>
		  <TodoForm/>
		  <List/>
		  <Button title=''/>
	  </View>
  )
}

export default Todo
